import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { BankfileStopPaymentComponent } from 'app/payment/bankfile-stop-payment/bankfile-stop-payment.component';

const bankFileStopPaymentRoutes: Routes = [
  {
    path: '',
    component: BankfileStopPaymentComponent,
    data: {
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
];


@NgModule({
  imports: [RouterModule.forChild(bankFileStopPaymentRoutes)],
  exports: [RouterModule]
})


export class BankfileStopPaymentRoutingModule {
}
